--
-- Table structure for table `crm_activity_history`
--

DROP TABLE IF EXISTS `crm_activity_history`;
CREATE TABLE `crm_activity_history` (
  `id` int(10) unsigned NOT NULL auto_increment COMMENT 'table record id',
  `entity_table` varchar(64) collate utf8_unicode_ci default NULL COMMENT 'physical tablename for entity being tagged, e.g. crm_contact',
  `entity_id` int(10) unsigned NOT NULL default '0' COMMENT 'FK to entity table specified in entity_table column',
  `activity_type` varchar(64) collate utf8_unicode_ci default NULL COMMENT 'sortable label for this activity assigned be registering module or user (e.g. Phone Call)',
  `module` varchar(64) collate utf8_unicode_ci default NULL COMMENT 'Display name of module which registered this activity',
  `callback` varchar(64) collate utf8_unicode_ci default NULL COMMENT 'Function to call which will return URL for viewing details',
  `activity_id` int(10) unsigned NOT NULL default '0' COMMENT 'FK to details item - passed to callback',
  `activity_summary` varchar(255) collate utf8_unicode_ci default NULL COMMENT 'brief description of activity for summary display - as populated by registering module',
  `activity_date` date default '0000-00-00' COMMENT 'when did this activity occur',
  `relationship_id` int(10) unsigned default NULL COMMENT 'OPTIONAL FK to crm_relationship.id. Which relationship (of this contact) potentially triggered this activity, i.e. he donated because he was a Board Member of Org X / Employee of Org Y',
  `group_id` int(10) unsigned default NULL COMMENT 'OPTIONAL FK to crm_group.id. Was this part of a group communication that triggered this activity?',
  PRIMARY KEY  (`id`),
  KEY `relationship_id` (`relationship_id`),
  KEY `group_id` (`group_id`),
  CONSTRAINT `crm_activity_history_ibfk_1` FOREIGN KEY (`relationship_id`) REFERENCES `crm_relationship` (`id`),
  CONSTRAINT `crm_activity_history_ibfk_2` FOREIGN KEY (`group_id`) REFERENCES `crm_group` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

