--
-- Table structure for table `crm_contact`
--

DROP TABLE IF EXISTS `crm_contact`;
CREATE TABLE `crm_contact` (
  `id` int(10) unsigned NOT NULL auto_increment COMMENT 'Unique Contact ID',
  `domain_id` int(10) unsigned NOT NULL default '0' COMMENT 'Which Domain owns this contact',
  `contact_type` enum('Individual','Organization','Household') collate utf8_unicode_ci default NULL COMMENT 'Type of Contact.',
  `legal_identifier` varchar(32) collate utf8_unicode_ci default NULL COMMENT 'May be used for SSN, EIN/TIN, Household ID (census) or other applicable unique legal/government ID.',
  `external_identifier` varchar(32) collate utf8_unicode_ci default NULL COMMENT 'Unique trusted external ID (generally from a legacy app/datasource). Particularly useful for deduping operations.',
  `sort_name` varchar(64) collate utf8_unicode_ci default NULL COMMENT 'Name used for sorting different contact types',
  `home_URL` varchar(128) collate utf8_unicode_ci default NULL COMMENT 'optional "home page" URL for this contact.',
  `image_URL` varchar(128) collate utf8_unicode_ci default NULL COMMENT 'optional URL for preferred image (photo, logo, etc.) to display for this contact.',
  `source` varchar(255) collate utf8_unicode_ci default NULL COMMENT 'where domain_id contact come from, e.g. import, donate module insert...',
  `preferred_communication_method` enum('Phone','Email','Post') collate utf8_unicode_ci default NULL COMMENT 'What is the preferred mode of communication.',
  `do_not_phone` tinyint(1) default '0',
  `do_not_email` tinyint(1) default '0',
  `do_not_mail` tinyint(1) default '0',
  `do_not_trade` tinyint(1) default '0',
  `hash` int(10) unsigned NOT NULL default '0' COMMENT 'Key for validating requests related to this contact.',
  PRIMARY KEY  (`id`),
  KEY `index_sort_name` (`sort_name`),
  KEY `domain_id` (`domain_id`),
  CONSTRAINT `crm_contact_ibfk_1` FOREIGN KEY (`domain_id`) REFERENCES `crm_domain` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

